 *
 * 446576656c6f7065723a20416e746f6e20506f6c656e79616b61 ****/

// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.15;

import "./abstract/SnacksBase.sol";

contract Snacks is SnacksBase {
    // ================= Library using =================================================================
    using SafeERC20 for IERC20;
    using PRBMathUD60x18 for uint256;
    // ================= Constants =====================================================================

    uint256 public constant SNACKS_MULTIPLIER = 0.000001 * 10**18; // 18 - decimals(
    uint256 public constant FEE_PULSE = 30;
    uint256 public constant D = 1000000;
    uint256 public constant FEE_MASTERCHEF = 30;
    uint256 public constant FEE_SNACKS_STAKING = 15;
    uint256 public constant FEE_BTCETH_SNACK_HOLDERS = 0;
    uint256 public constant FEE_SNACK_HOLDERS = 15;
    uint256 public constant FEE_ZOINKS_STAKING = 5;
    uint256 public constant FEE_SENIORAGE = 5;

    // ================= Attributies/Properties ========================================================

    IERC20 public immutable btcSnacks; // BtcSnacks contract address
    IERC20 public immutable ethSnacks; // EthSnacks contract address
    address public immutable zoinksStakingPool; // Zoinks Staking Pool contract address (Zoinks Staking)

    // ================= Constructors ===================================================================

    constructor(
        IERC20 zoinks_, // The ZOINKS TOKEN!
        address pulse_,
        address masterChef_,
        address zoinksStakingPool_,
        address snacksStakingPool_,
        IERC20 btcSnacks_,
        IERC20 ethSnacks_,
        address seniorageAddress_
    )
        SnacksBase(
            zoinks_,
            pulse_,
            masterChef_,
            snacksStakingPool_,
            "SNACKS",
            "SNACKS",
            SNACKS_MULTIPLIER,
            seniorageAddress_,
            FEE_PULSE,
            FEE_MASTERCHEF,
            FEE_SNACKS_STAKING,
            FEE_BTCETH_SNACK_HOLDERS,
            FEE_SNACK_HOLDERS,
            FEE_ZOINKS_STAKING,
            FEE_SENIORAGE
        )
    {
        btcSnacks = btcSnacks_;
        ethSnacks = ethSnacks_;
        zoinksStakingPool = zoinksStakingPool_;

        _blockedHolders[address(btcSnacks)] = true;
        _blockedHolders[address(ethSnacks)] = true;
        _blockedHolders[zoinksStakingPool] = true;

        isInitilized = true;
    }

    // ================= Methods: Publics/External ======================================================

    // Description:
    //  Calculate pending undistributed fee in BtcSnacks.
    function undistributedFeeBTCSnacks() public view returns (uint256) {
        return btcSnacks.balanceOf(address(this));
    }

    // Description:
    //  Calculate pending undistributed fee in EthSnacks.
    function undistributedFeeETHSnacks() public view returns (uint256) {
        return ethSnacks.balanceOf(address(this));
    }

    function _beforeDistributeFee(
        uint256 feeSnacks_,
        uint256 totalHoldersBalance_
    ) internal override {
        if (feeSnacks_ > 0) {
            // % Snacks holders
            uint256 feeToHolders = (feeSnacks_ * feeSnacksHolders) / 100;
            // Calculate and give fee of snacks to every holder
            // Check if we have any holder with balance, if is not correct, we save this fee to next lap
            if (totalHoldersBalance_ > 0) {
                for (uint256 i = 0; i < holderList.length; i++) {
                    uint256 holderBalance = balanceOf(holderList[i]);
                    uint256 holderFee = (feeToHolders / totalHoldersBalance_) *
                        holderBalance;
                    _selfTokenSnacks.transfer(holderList[i], holderFee);
                }
            }
            // % Zoinks staking pool
            if (feeZoinksStakingPool > 0) {
                _selfTokenSnacks.transfer(
                    zoinksStakingPool,
                    (feeSnacks_ * feeZoinksStakingPool) / 100
                );
            }
        }
    }

    function _afterDistributeFee(uint256 totalHoldersBalance_)
        internal
        override
    {
        // STEP 2: Distribute fee of BTCSnacks
        uint256 feeBtcSnacks = undistributedFeeBTCSnacks();
        if (feeBtcSnacks > 0 && totalHoldersBalance_ > 0) {
            // Calculate and give fee of btc snacks to every holder
            for (uint256 i = 0; i < holderList.length; i++) {
                uint256 holderBalance = balanceOf(holderList[i]);
                uint256 holderFee = (feeBtcSnacks * holderBalance) /
                    totalHoldersBalance_;
                uint256 btcBalance = btcSnacks.balanceOf(address(this));
                uint256 amount = (btcBalance >= holderFee)
                    ? holderFee
                    : btcBalance;
                btcSnacks.safeTransfer(holderList[i], amount);
            }
        }
        // STEP 3: Distribute fee of ETHSnacks
        uint256 feeEthSnacks = undistributedFeeETHSnacks();
        if (
            feeEthSnacks > 0 &&
            totalHoldersBalance_ > 0 &&
            holderList.length > 0
        ) {
            // Calculate and give fee of btc snacks to every holder
            for (uint256 i = 0; i < holderList.length; i++) {
                uint256 holderBalance = balanceOf(holderList[i]);
                uint256 holderFee = (feeEthSnacks * holderBalance) /
                    totalHoldersBalance_;
                uint256 ethBalance = ethSnacks.balanceOf(address(this));
                uint256 amount = (ethBalance >= holderFee)
                    ? holderFee
                    : ethBalance;
                ethSnacks.safeTransfer(holderList[i], amount);
            }
        }
    }

    function _D() internal pure override returns (uint256) {
        return D;
    }
}
